choices.text:
parser.parseArray(componentType, array, fieldName);


if (array.size() == 0) {
    return (T) new byte[0];
}

parser.accept(JSONToken.LBRACKET);
for (;;) {
    Object item = parser.parseObject(componentType, null);
    if (item == null) {
        break;
    }
    array.add(item);
    if (lexer.token() == JSONToken.COMMA) {
        lexer.nextToken();
        continue;
    }
    break;
}
parser.accept(JSONToken.RBRACKET);

